import React from 'react';
import CheckBox from './checkBox';
import './sideDrawer.css';

function subscription(props) {
    return (
        <div className="subscription">
            <h1>SUBSCRIPTION</h1>
        <CheckBox/> <p>Free</p>
        <CheckBox/> <p>Premium</p>
        
        </div>

    );
}

export default subscription;
